var x=10,y=10;
var t=0;

var cam={x:0,y:0};

var l={x:1,y:0};

var walk = 0;
var fall = 1;

var states = ["walk","fall","para","block","dig"];

var frlth = {walk:8,fall:4,para:5,block:1,dig:16};
var froff = {walk:1,fall:9,para:19,block:13,dig:48};

var mouse = {lspr:17,lemid:-1,x:0,y:0,down:0};
tools = {dropt:60,climb:0,para:10,bomb:0,stop:4,
        build:0,bash:0,mine:0,dig:99,pause:0,nuke:0};

var toolnames = ["droprate","climber","floater","bomber",
                 "blocker","builder","basher","miner",
                 "digger","pause","nuke"];
var toolkeys = ["dropt","climb","para","bomb","stop","build","bash","mine","dig","pause","nuke"];


var sel = 1;

//create lemmigns
var lems = [];
var unborn = 10;
var winners = 0;
var alive = 0;
var total = unborn;

var fx = [];

var goal = {x:-1,y:-1};
//for(var i = 0;i<10;i++)
//lems.push({x:33+15*i,y:30,dir:1,st:0,frm:0,para:0});

//create map
var mwidth=0;
var mheight=0;
var minimap = [];
var starttile =[-1,-1];
var endtile = [-1,-1];
for(var i=0;i<128;i++)
{
  minimap[i] = [];
  for(var j = 0;j<128;j++)
  { 


    minimap[i][j] = 0;
    var tile = mget(i,j);
    if(tile == 136) {
      starttile = [i,j];
      mset(i,j,0);
      tile = 0; 
    }
    if(tile == 137) {
      endtile = [i,j];
      goal.x = 16*i+16;
      goal.y = 16*j+24;
      mset(i,j,0);
      tile = 0;
    }
    if(tile) {
       minimap[i][j] = tile;
       if(i > mwidth) mwidth = i;       
       if(j > mheight) mheight = j;
    }
  }
}

var excol = [];
for(var i = 0;i<mwidth*16;i++)
{
  excol[i] = [];
  for(var j = 0;j<mheight*16;j++)
  excol[i][j] = 0;
}

var cammax = {x:16*mwidth-width()+16,y:16*mheight};


function ssx(n){ return n % ssget(); }
function ssy(n){ return flr(n / ssget()) % (ssget() * ssget()); }

function updlems(){
  if(t % tools.dropt == 0 && unborn > 0) {
    unborn--;
    alive++;
    lems.push({x:starttile[0]*16+16,y:starttile[1]*16+12,
              dir:1,st:0,frm:0,para:0,fall:0});
  }

  mouse.x = mousex()-cam.x;
  mouse.y = mousey()-cam.y;
  mouse.lemid = -1;
  for(var i=0;i<lems.length;i++)
  {
    var die = 0;
    var state = lems[i].st;
    var x = lems[i].x; var flx = flr(x);
    var y = lems[i].y; var fly = flr(y);
    var mx = x%16; var my3 = (y-3)%16;
    var my = y%16; var my1 = (y-1)%16; var my2 = (y+1)%16;
    var tile = mget(flr(x/16),flr(y/16));
    var tile2= mget(flr(x/16),flr((y-1)/16));
    var tile3= mget(flr(x/16),flr((y+1)/16));
    var tile4= mget(flr(x/16),flr((y-3)/16));
    var pixel = sget(16*ssx(tile)+mx,16*ssy(tile)+my);
    var pixel1= sget(16*ssx(tile2)+mx,16*ssy(tile2)+my1);
    var pixel2= sget(16*ssx(tile3)+mx,16*ssy(tile3)+my2);
    var pixel3= sget(16*ssx(tile4)+mx,16*ssy(tile4)+my3);

    if(1==excol[flx][fly])   pixel= 0;
    if(1==excol[flx][fly-1]) pixel1=0;
    if(1==excol[flx][fly-3]) pixel3=0;
    if(1==excol[flx][fly+1]) pixel2=0;

    if(pixel1 != 0 && pixel3 != 0 && state == 0){lems[i].dir *=-1;}
    if(tile == 0 || (pixel == 0 && pixel2 == 0) ) //falling
    {
      lems[i].st = fall;
      lems[i].y++;
      lems[i].fall++;
      if(lems[i].para && lems[i].fall > 20)
      {
        lems[i].y-=0.5;
        lems[i].st = 2;
        lems[i].fall--;
      }
    }
    else 
    {
      if(lems[i].st == 4) //digging
      {
        lems[i].y+=0.1;
        var x = flr(lems[i].x);
        var y = flr(lems[i].y);
        for(var k = -4;k < 4;k++)
          excol[x+k][y] = 1;
      }
      else if(lems[i].st != 3 )
      {
        if(lems[i].fall > 64) {
          die=1; 
          fx.push({type:0,x:x,y:y,t:0,tmax:14});
          sfx(4);
        }
        lems[i].fall = 0;
        lems[i].st = walk;
        lems[i].x += 0.5*lems[i].dir;
        if(pixel1 != 0) lems[i].y-=1;
      }
    }

    if(abs(mouse.x - lems[i].x) < 4) {
      if(abs(mouse.y - lems[i].y+4) < 4) {
        mouse.lemid = i;
      }
    } 

    lems[i].frm = (lems[i].frm+0.5)%frlth[states[lems[i].st]];

    if(abs(lems[i].x - goal.x) < 2) {
      if(abs(lems[i].y - goal.y) < 4) {
        fx.push({type:1,x:x,y:y-4,t:0,tmax:8});
        winners++;
        die =1;
        alive--;
        sfx(3);
      }
    }

    if(die) {
      lems.splice(i,1);
    }
  }
}

function click(){
  mouse.down = 1;
  //tool click
  if(mouse.y > height()-24 && mouse.x+cam.x < toolnames.length*16)
  {
    if(mouse.x+cam.x > 16)
    {
      sel = flr((mouse.x+cam.x)/16);
      sfx(1);
    }
  }
  else if(mouse.lemid != -1)
  {  
    if(tools[toolkeys[sel]] > 0)
    {
      sfx(0);
      tools[toolkeys[sel]]--;
      if(sel == 2) //parachute
      {
        lems[mouse.lemid].para = 1; 
      }
      else if(sel == 4)
      {
        lems[mouse.lemid].st = 3;
        var x = flr(lems[mouse.lemid].x);
        var y = flr(lems[mouse.lemid].y);
        excol[x][y] = 1;
        excol[x][y-1]=1;
        excol[x][y-2]=1;
      }
      else if(sel == 8)
      {
        lems[mouse.lemid].st = 4;
      }
    }
    else
    {
      sfx(2);
    }
  }

}

function drawlems(){
  for(var i=0;i<lems.length;i++)
  {
    var st = lems[i].st;
    var fr = lems[i].frm;
    var dir = (lems[i].dir-1)/2;
    spr(flr(froff[states[st]]+fr),lems[i].x-8,lems[i].y-9,1,1,dir,0);
   // pset(lems[i].x,lems[i].y,12);
  }

  for(var i=0;i<fx.length;i++)
  {
    var type = fx[i].type;
    if(type == 0) //falldeath
    {
      spr(32+flr(fx[i].t),fx[i].x-8,fx[i].y-9);
    }
    else if(type == 1) //winjump
    {
      spr(24+flr(fx[i].t),fx[i].x-8,fx[i].y-9);
    }

    fx[i].t += 0.4;
    if(fx[i].t > fx[i].tmax) fx.splice(i,1);
  }
}

function drawgui(){
  spr(160,0-cam.x,216-cam.y,11,2);
  spr(171,16*sel-cam.x,216-cam.y,1,2);
  camera(0,0);

  //text
  print(""+tools.dropt, 5,219,0);
  print(""+tools.climb, 21,219,0);
  print(""+tools.para,  37,219,0);
  print(""+tools.bomb,  53,219,0);
  print(""+tools.stop,  69,219,0);
  print(""+tools.build, 85,219,0);
  print(""+tools.bash,  101,219,0);
  print(""+tools.mine , 117,219,0);
  print(""+tools.dig,   133,219,0);

  print("out: "+alive,80,210,7);
  print("in: "+flr(100*winners/total) +"%",130,210,7);
  if(sel != -1)
    print(toolnames[sel],20,210,7);
  //minimap
  for(var i=0;i<=mwidth;i++)
  {
    for(var j=0;j<=mheight;j++)
    {
      var tile = minimap[i][j];
      if(tile) {
        if(fget(tile,1)){
          pset(176+2*i,214+2*j,13);
          pset(176+2*i+1,214+2*j,13);
        }
        if(fget(tile,0)) {
          pset(176+2*i,214+2*j+1,13);
          pset(176+2*i+1,214+2*j+1,13);
        }
      }
    }
  }
  camera(cam.x,cam.y);
  spr(133,176-cam.x-cam.x/8,214-cam.y-cam.y/8,2,2);

}

function drawremoved(){
  for(var i=0;i<excol.length;i++)
  {
    for(var j=0;j<excol[i].length;j++)
    {
      var col = excol[i][j];
      if(col == 1) {
        pset(i,j,0);
      }
    }
  }
}

function drawmouse(){
  var mx = mousex();
  var my = mousey();
  var pspr = 17;
  if(mouse.lemid != -1) mouse.lspr = 18;
  else mouse.lspr = 17;

  if(mx > width()-20) cam.x--;
  if(mx < 20) cam.x++;
  cam.x = clamp(cam.x,-cammax.x,0);
  spr(mouse.lspr,mx-cam.x-8,my-cam.y-8);
}

function drawgoal() {
  if(endtile[0] == -1) return;

  spr(130,endtile[0]*16,endtile[1]*16,2,2);
  spr(128,starttile[0]*16,starttile[1]*16,2,2);
}

function _update()
{
  l.x = (l.x+0.5)%8;

  updlems();
  t++;
}

function _kill()
{
  camera(0,0);
  var x = starttile[0];
  var y = starttile[1];
  mset(x,y,136);
  mset(x+1,y,0);
  mset(x,y+1,0);
  mset(x+1,y+1,0);

  x = endtile[0];
  y = endtile[1];

  mset(x,y,137);
}

